    false,nt"url": null,nt"notes": "A form and instructions for quickly and
    briefly assessing a previously (prior to 2013) reviewed or approved survey protocol
    for use as a National or Regional survey protocol  framework in the National Wildlife
    Refuge System.  The form provides a simple numeric (%) score that indicates amount
    of inclusion of desired content for a survey protocol relative to the newly developed
    Refuge System standard (see How to Develop Survey Protocols: A Handbook).  A low
    percent value would mean that a relatively great amount of work would be needed
    in using the framework to develop a site-specific survey protocol.  The form also
    provides a section for recommending the status, how the protocol can be used, and
    what may need to be added to develop a site-specific survey protocol from the framework.
     The latter advice is provided through written comment. The last two pages include
    a form for supplemental assessments conducted by others to add missed points or
    alternative perspectives on the protocol.",nt"license_title": "License Not
